import React, { Component } from 'react';
import CheckInMenu from './CheckInMenu';
import { PARK_LOCATIONS } from '../../constants';
import { viewPlace } from '../../actions/checkIn';
import PlaceViewer from './PlaceViewer';
import './styles.css';

class CheckIn extends Component {

  state = {
    user: this.props.activeUser,
    locationViewed: undefined
  };


  render() {
    return (
      <div id="PageWrapper">
        <div id="LeftWrapper">
          <CheckInMenu 
            options={PARK_LOCATIONS}
            onSubmitHandler={(location)=>{viewPlace(this, location)}}
          />
        </div>
        <div id={`RightWrapper ${this.state.locationViewed !== undefined ? '' : 'hidden'}`}>
          <PlaceViewer location={this.state.locationViewed} />
        </div>
    {this.state.locationViewed !== undefined ? <PlaceViewer location={this.state.locationViewed} /> : <p> none selected </p> }
      </div>
    );
  }
}

export default CheckIn;
